description:
SG-1 vindt in de Tok'ra, een vriendelijke afsplitsing van de goa'uld, en de Asgard, een technologisch zeer geavanceerd ras, bondgenoten voor hun strijd tegen de Goa'uld.


17.Holiday - 5 februari 1999 - SG-1 ontmoet Ma'chello die van lichaam wisselt met Daniel.

18.Serpent's Song - 12 februari 1999 - Apophis vraagt asiel aan bij SGC omdat Sokar hem wil doden.

19.One False Step - 19 februari 1999 - Als SG-1 in een communie komen breekt er plotseling een epidemie uit.

20.Show and Tell - 26 februari 1999 - SG-1 maakt kennis met de Retou die een aanval openen op het SGC.

